import React, { Component } from 'react'

export default class Table extends Component {
    render() {
        let tableCols = Object.getOwnPropertyNames(this.props.data[0]);
        return (
            <table>
                <tbody>
                    <tr>
                    {
                        tableCols.map((val,index) => <th key={index}>{val}</th>) 
                    }
                    </tr>
                    {
                        this.props.data.map((val, index) =>{
                            return(
                                <tr key={index}>
                                    <th>{val.Class}</th>
                                    <th>{val.Date}</th>
                                    <th>{val.Instructor}</th>    
                                </tr>
                            )
                        })
                    }
                </tbody>
            </table>
        )
    }
}
